      SELECT + col0 * + - 31 + 87 + ( - col2 ) + col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 38 BETWEEN - + col2 AND 72 + 1;
  - name: tab2

outputs:
  - name: q9821.out
    data: |
      -1339
